      >
          <div className="flex h-[30vh] justify-center rounded-lg items-center">
            <p className="text-5xl md:text-6xl text-center text-white tracking-widest mt-[80px] interf pb-2">
              RA
            </p>
          </div>
      </div>
  );
}
